webpackJsonp([44579025458899],{548:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Eh, I Could Eat",author:"Jacob Aronoff"}},markdownRemark:{id:"/Users/jea/Documents/Code/github/icouldeat/src/pages/brooklyn-bagel-company/index.md absPath of file >>> MarkdownRemark",html:'<h3>Bacon Egg and Cheese</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/picture-7a4f623a7060e171ef8494bd4c449b36-01800.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Bacon Egg and Cheese"\n        title=""\n        src="/static/picture-7a4f623a7060e171ef8494bd4c449b36-f8fb9.jpg"\n        srcset="/static/picture-7a4f623a7060e171ef8494bd4c449b36-e8976.jpg 148w,\n/static/picture-7a4f623a7060e171ef8494bd4c449b36-63df2.jpg 295w,\n/static/picture-7a4f623a7060e171ef8494bd4c449b36-f8fb9.jpg 590w,\n/static/picture-7a4f623a7060e171ef8494bd4c449b36-85e3d.jpg 885w,\n/static/picture-7a4f623a7060e171ef8494bd4c449b36-d1924.jpg 1180w,\n/static/picture-7a4f623a7060e171ef8494bd4c449b36-9452e.jpg 1770w,\n/static/picture-7a4f623a7060e171ef8494bd4c449b36-01800.jpg 4032w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I had heard a lot about this being one of the best bagel places in NYC. Intrigued, I had to go try it out. I got a plain bagel, with BEC (bacon, egg, and cheese): the classic. Overall, it was pretty good; but not as good as my favorite bagel spot on 35th and 8th (Best Bagel and Coffee.) I think this might have been a better BEC, but the actual bagel itself wasn’t as good. I think I’d go back and give it another try with just plain cream cheese as that normally makes it easier to just taste the bagel.</p>\n<p>Rating 8/10</p>',frontmatter:{title:"Brooklyn Bagel & Coffee Company",date:"January 15, 2018"}}},pathContext:{slug:"/brooklyn-bagel-company/",previous:{fields:{slug:"/chefs-club-counter/"},frontmatter:{title:"Chefs Club Counter"}},next:{fields:{slug:"/noodle-bar-brushstroke/"},frontmatter:{title:"Noodle Bar at Brushstroke"}}}}}});
